import { useEffect, useState } from "react";

const Home = () => {
  const [users, setUsers] = useState(null);

  useEffect(() => {
    fetch("/api/users")
      .then((res) => {
        if (res.ok) {
          return res.json();
        }
      })
      .then((data) => {
        setUsers(data);
      });

    // const fetchUsers = async () => {
