    //   const json = await response.json();

    //   if (response.ok) {
    //     setUsers(json);
    //   }
    // };

    // fetchUsers();
  }, []);

  return (
    <div className="home">
      <h2>Home</h2>
      <div className="users">
        {users && users.map((user) => <p key={user._id}>{user.FirstName}</p>)}
      </div>
    </div>
  );
};

export default Home;
